import { useSelector, useDispatch } from 'react-redux';
import { useState } from 'react';
import React from 'react';

export const Cal1 = (props) => {
    const dist = props.dist

    let count = useState(0)

    const add = () => {
        alert(dist)
        count = count + dist
        alert(count)

        return count;
    }
    const sub = () => {
        count = count - dist
        return count
    }
    return (
        <div>
            <h1>{count}</h1>
            <h1><button type="button" onClick={add}>- {dist}</button>   
            <button type="button" onClick={sub}>+ {dist}</button>         
            </h1>
        </div>
    );
};
